Pilatus, also often referred to as Mount Pilatus, is a mountain massif overlooking Lucerne in Central Switzerland. It is composed of several peaks, of which the highest is named Tomlishorn. Maker of weather, dragon's lair, home to giants and grave of rulers: Lucerne's very own mountain, Pilatus, is one of the most legendary places in Central Switzerland. And one of the most beautiful. On a clear day the mountain offers a panoramic view of 73 Alpine peaks.
One of the main activities to enjoy while taking in the incredible views is hiking. Winter sees many of the hiking trails closed, however, there are still plenty of activities on offer on the mountain, including skiing, tobogganing, and sledging.
Make sure you visit it. 
