Les gorges se trouvent dans la vallée du Hasli qui s’étend du col du Grimsel au lac de Brienz et qui est barrée par le Kirchet, un imposant rempart de rocher à travers lequel l'Aar a creusé un passage au cours des millénaires, formant des gorges d'une longueur de 1 400 mètres et d'une profondeur de 180 mètres.

