Вчера в разговоре с другом я упомянула, что до сих пор не доехала до Алетчского ледника. Погоду обещали хорошую, никаких важных дел запланировано не было. Поэтому вернувшись домой, решила, что надо проснуться пораньше и ехать. Погуглив немного, определилась с маршрутом, хотя были сомнения осилю ли. Но уж очень хотелось подольше идти вдоль самого ледника. В итоге от станции Moosfluh дошла до озера Märjelensee, а дальше до подъемника Fiescheralp. Испытанный восторг во время прогулки даже не буду пытаться описывать //

Glacier d’Aletsch.

Hier en parlant avec un ami, je lui ai dit que je n'avais pas encore visité le fameux Glacier d'Aletsch. Je suis rentrée à la maison et j'ai spontanément décidé qu'il fallait aller là-bas lendemain comme j'avais du temps et il faisait beau. Après quelques recherches sur internet j'ai déterminé mon parcours qui me permettrait marcher le long du glacier. J'ai commencé ma balade par la station Moosfluh en marchant vers le lac Märjelensee et j'ai terminé ma randonnée en arrivant vers le téléférique Fiescheralp.

